import Home from './screens/Home';
import { Fragment } from 'react';
function App() {
  return (
    <Fragment>
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          {/* Add more routes as needed */}
        </Routes>
      </Router>
    </Fragment>
  );
}
export default App
